import React from 'react';
import { Button } from 'react-bootstrap';
import logo from './logo.svg';
import star from './star.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Button></Button>
      <header className="App-header">
        <img src={star} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
